    "Summary": "<p>PK 13-14 de Plagron es un fertilizante que se añade a los fertilizantes básicos para conseguir un engorde monstruoso de los cogollos que se usa en la segunda etapa de la floración.PK 13-14 de Plagron es un fertilizante que se añade a los fertilizantes básicos para conseguir un engorde monstruoso de los cogollos que se usa en la segunda etapa de la floración.</p>",
    "Description": "<p><strong>PK 13-14 de Plagron es un potente abono</strong> que se añade en conjunto con las bases de fertilizantes para promover un crecimiento explosivo de las flores que se usa en la segunda etapa de la floración. Conseguiremos que los cogollos aumenten de peso y densidad para que la cosecha gane en cantidad y calidad.</p><p>Cuando llegamos a la fase de engorde, nuestras plantas necesitan un aporte extra de fósforo y potasio (PK) con el que formar sus frutos más gordos en la fase final de la planta, por lo que consumen más que durante todo el ciclo anterior junto. Mezcla PK 13/14 con tu abono base, sea Terra Cocos o Hydro A+B, en la fase de engorde de tus plantas; más o menos desde la 4ª semana hasta el final del cultivo. Verás cómo tus flores llegan a ser mucho más gordas y pesadas que de costumbre.</p> <p>El fósforo y el potasio intervienen en numerosos procesos metabólicos de las plantas, además de formar parte directamente de las paredes celulares y de la carga de azúcares del núcleo celular, se consideran esenciales para formar flores y conseguir un tamaño y peso más elevados en nuestro producto final.</p> <p>Dosis y modo de empleo de Pk 13/14 de Plagron:</p> <ul><li>Añade 1,5ml por litro durante la fase de engorde de nuestras plantas, en conjunto con Terra Bloom, Cocos A+B o Hydro.</li> <li>No conviene sobrepasar la dosis indicada, podríamos sobre-fertilizar nuestras plantas.</li> </ul><p>Composición de PK 13 14 de Plagron:</p> <p>NPK 0-13-14</p> <ul><li>13% Óxido de fósforo.</li> <li>14% Óxido de potasio.</li> </ul>",
