    "Description": "<p><strong>Power Roots de Plagron es un estimulador de la raíz 100% orgánico</strong> que acelera el crecimiento y mejora la floración,formando un buen sistema radicular. Con este producto tus plantas desarrollarán enormemente sus raíces y asimilarán grandes cantidades de nutrientes, lo que permitirá una explosión en el crecimiento y una floración exuberante y rapidísima.</p> <p>Cuantas más raíces tengamos, más planta tendremos y más resistente será a todo tipo de problemas. Es muy importante para la correcta formación de nuestras plantas que la zona radicular sea una buena masa y esté sana. Si no hay raíces sanas la planta no se alimenta bien.</p> <p>Power Roots se añade a los fertilizantes básicos como complemento para mejorar el rendimiento en nuestros cultivosde marihuana. Generalmente se utiliza en combinación con una base, como Terra A+B, Cocos A+B o Hydro A+B,durante las primeras semanas de crecimiento, tras cada trasplante, y en las primeras semanas de floración.</p> <p>Consulta la sencilla tabla de cultivo de Plagron para darles a tus plantas los fertilizantes en las cantidades y en los tiempos óptimos como lo haría un profesional.</p> <p>Dosis y modo de empleo de Power Roots:</p> <ul><li>Añadiremos 1ml por litro durante las dos primeras semanas del crecimiento y repetir dos semanas el tratamiento en cada trasplante.</li> <li>Usa la misma dosis cuando la pasemos a floración y la trasplantemos en la maceta definitiva .</li> </ul><p>Composición de Power Roots de Plagron:</p> <p>NPK 1-0-2</p> <ul><li>Ácidos húmicos.</li> <li>Extracto de algas marinas.</li> <li>Ácido ascórbico.</li> <li>Aminoácidos.</li> <li>Vitamina E.</li> <li>Vitamina B1.</li> </ul>",
