    "Manufacturer": "Genehtik seeds",
    "Quantity": 100,
    "Summary": "<p>La Kritikal Bilbo Auto de Genehtik Seeds, es una planta autofloreciente de nueva generación, con alta potencia y producción. Sus plantas alcanzan los 60-70cm de altura y desarrollan montones de ramas cargadas de densos brotes aromáticos. La Kritikal Bilbo Auto necesita 60-70 días para producir sus sabrosos frutos, en una media de 40g por planta en el interior – y 70g en el exterior.</p>",
    "Description": "<p>La Kritikal Bilbo Auto de Genehtik Seeds <strong>es el resultado del cruce y el recruce de la Kritikal Bilbo con varias cepas autoflorecientes,</strong> para crear una variedad autofloreciente de nueva generación con más potencia y producción. Sus plantas son extremadamente rápidas y comienzan su floración tras solo 2 semanas de crecimiento vegetativo.</p><p>La Kritikal Bilbo Auto de Genehtik Seeds es una planta de tamaño mediano que alcanza una altura de 60-70cm; bastante pequeña (ideal para su cultivo en el interior o en el balcón/patio), pero con numerosas ramas. Su vigoroso crecimiento es la razón de su producción – sus ramas están repletas de enormes brotes densos.</p><p> Los brotes de la Kritikal Bilbo Auto harán que se te salten los ojos con su enorme tamaño y aspecto casi blanco y tu sentido del olfato se regalará con su aroma afrutado.</p><p>La Kritikal Bilbo Auto de Genehtik Seeds produce 40g de hierba de gran calidad por planta en el interior (70g en el exterior) tras solo 60-70 días de floración – hierba con un delicioso sabor afrutado y un fuerte efecto narcótico, perfecto para relajarse.</p>",
