    "Summary": "<p>La Goxuak de Genehtik Seeds, es el vástago autofloreciente de la famosa AK-47 y una variedad autofloreciente. Para producir sus brotes resinosos de aroma afrutado AK-47, necesita un periodo de floración de 9 semanas (en el exterior, 60-70 días en el interior) tras los cuales produce unos 50g por planta – buena cantidad para una planta que solo alcanza los 40-60cm. Subidón Sativa total.</p>",
    "Description": "<p>La Goxuak de Genehtik Seeds <strong>es el vástago feminizado y autofloreciente del cruce entre la galardonada y legendaria AK-47 y una cepa autofloreciente.</strong> El resultado es una planta pequeña con una gran producción y el aroma afrutado de su famoso padre. Solo necesita de 2 semanas de crecimiento vegetativo para comenzar su periodo de floración.</p><p>La Goxuak feminizada de Genehtik Seeds alcanza una altura de solamente 40-60cm, pero produce unos hermosos brotes centrales cargados de resina, en tan solo 60-70 días de floración, en el interior; en el exterior tarda + 9 semanas. Y servirá sus deliciosos frutos de sabor dulce y subidón Sativa.</p>",
