    "Manufacturer": "Medical seeds",
    "Quantity": 100,
    "Summary": "<p>Las semillas de Cannabis de Y Griega del banco Medical seeds® es una cepa de marihuana hibrida al 80% sativa. A pesar de ser Sativa, esta planta nos sorprende con una producción de cogollos robustos, grandes y extremadamente resinosos, que cubre todos los tallos.</p>",
    "Description": "<p>Las semillas de Cannabis de Y Griega del banco Medical Seeds® <strong>es una cepa de marihuana hibrida al 80% sativa.</strong> A pesar de ser Sativa, esta planta nos sorprende con una producción de cogollos robustos, grandes y extremadamente resinosos, que cubre todos los tallos.</p><p>En un análisis de cromatografía de gases realizado por Canna Resort ha obtenido el máximo nivel de THC entre todas nuestras plantas. Es decir, es la variedad con más alto nivel de THC de todo nuestro banco, extremadamente potente.</p><p>Su efecto empieza con una fuerte sacudida energética que lentamente desencadena en un estado de lucidez y relajación. Es una planta que mantiene un olor clásico a Haze, que se combina con un ligero toque dulzón que la hace destacar.</p><p>Y Griega es una variedad que empieza su crecimiento con un vigor espectacular, por lo que es muy aconsejable cultivarla en SCROG, debido a que se hace más controlable. Especialmente recomendada para enfermedades que requieran altos niveles de THC como el glaucoma.</p><p>En conclusión, Y Griega colmará tus expectativas si buscas una planta con un elevadísimo nivel de THC, muy potente y con posibles aplicaciones terapéuticas.</p><ul><li>80% Sativa 20% Indica</li><li>Período floración en interior: 12-13,5 semanas.</li><li>Producción en interior/m2: 500 gr.</li><li>Altura en exterior: alcanza los 3,5 m de altura.</li><li>Producción en exterior/planta: 500-600 gr.</li><li>Genotipo: Cruce entre Amnesia Haze x Kali Mist.</li><li>THC: muy alto.</li><li>CBD: muy bajo.</li></ul>",
