    "Reference #": "1024ZX40",
    "Manufacturer": "Medical seeds",
    "Quantity": 100,
    "Summary": "<p>1024 del banco Medical seeds® lo combina todo: sabor, olor, producción, presencia y potencia. Es la planta perfecta, nos sentimos orgullosos de este cruce. Se adapta perfectamente a todos los sistemas de cultivo, (orgánico, coco, hidropónico…). Si sus condiciones son óptimas su nivel de THC puede ser muy alto.</p>",
    "Description": "<p>1024 del banco Medical Seeds® <strong>lo combina todo: sabor, olor, producción, presencia y potencia. Es la planta perfecta,</strong> nos sentimos orgullosos de este cruce. Se adapta perfectamente a todos los sistemas de cultivo, (orgánico, coco, hidropónico…). Si sus condiciones son óptimas su nivel de THC puede ser muy alto. Ten en cuenta que puede no ser recomendada para fumadores noveles.</p><p>También hay que decir que es muy recomendable para cultivos en exterior por la producción extremadamente alta que tiene. Al ser de ascendencia sativa permite desarollar un más que notable tamaño en los cogollos, con unos niveles de resina espectaculares. Además 1024 tiene un contenido medio en CBD lo cual se traduce en que le confiere propiedades medicinales.</p><p>La verdad es que definir su sabor es realmente complejo, se combinan una serie de matices, todos ellos a la vez, (dulce, almizcle, especiado, frutal), aunque también podemos encontrar un fenotipo más acido y con toques a incienso.</p><p>En conclusión 1024 es una variedad muy agradecida debido a su gran rendimiento (tanto en interior como en exterior, pero especialmente en éste último), apta tanto para cultivadores nóveles como para los mas experimentados.</p><ul><li>Período floración interior: 11-13 semanas.</li><li>Producción en interior/m2: unos 600 gramos.</li><li>Altura en exterior: 3-3,5 metros.</li><li>Producción en exterior/planta:600-800 gr.</li><li>Genotipo:Top Secret.</li><li>THC: alto.</li><li>CBD: bajo.</li></ul>",
