    "Manufacturer": "Sensi Seeds",
    "Quantity": 100,
    "Summary": "<p>Super Skunk Automatic es una variedad de semillas de marihuana autoflorecientes feminizadas del banco SENSI SEEDS.<p/><p>Las exquisitas cualidades de la mundialmente famosa familia Super Skunk han sido mezcladas con un vigoroso ejemplar de Cannabis ruderalis para crear una variedad excepcional autofloreciente y feminizada de marihuana.</p>",
    "Description": "<p><strong>Super Skunk Automatic, como algunos híbridos autoflorecientes,<strong> tiene la ventaja</strong> de ser capaz de producir dos cosechas maduras de hembras en una sola temporada de cultivo exterior</strong> cuando se siembra en un clima cálido y soleado. En interior su capacidad de autofloración dispara el comienzo de la floración tras unas seis semanas de crecimiento vegetativo.</p><p>Incluso en manos de cultivadores inexpertos, esta variedad de semillas produce fácilmente una bonita cosecha de cogollos duros y brillantes. Super Skunk Automatic tiene un buen patrón de crecimiento y una fantástica estructura de cogollos. Se mantiene pequeña y compacta pero produce colas fuertes formadas por cálices excepcionalmente gruesos y pegajosos. Sus cogollos son dulces, muy resinosos y pegan fuerte, un efecto cerebral estimulante inmediato y potente seguido por una no menos poderosa y penetrante sensación de relajación física.</p><p>Características de Super Skunk Automatic:</p><ul>   <li>Tipo: Autofloreciente feminizada</li>   <li>Genotipo: 80% Índica</li>   <li>Cultivo interior y exterior (Templado / Continental)</li>   <li>Periodo de floración: 45-55 días</li>   <li>Producción: grande</li>   <li>Altura: compacta</li> </ul>",
