    "Summary": "<p>Skunk # 1 es simplemente una de las variedades de cannabis más importantes jamás creadas. Durante por lo menos a 30 años, la Skunk # 1 y sus innumerables descendientes han influido directamente en la cultura del cannabis de todo el mundo más que cualquier otra variedad.</p>",
    "Description": "<p>Skunk #1 Automatic <strong>es una variedad de semillas de marihuana autoflorecientes del banco SENSI SEEDS.</strong> Skunk # 1 es simplemente una de las variedades de cannabis más importantes jamás creadas. Durante por lo menos a 30 años, la Skunk # 1 y sus innumerables descendientes han influido directamente en la cultura del cannabis de todo el mundo más que cualquier otra variedad.</p><p>as variedades de Skunk destacan por su crecimiento sin problemas. Para principiantes y cultivadores experimentados por igual, Skunk #1 Automatic es una de los maneras más fáciles y rápidas de obtener cannabis medicinal o recreativo de alta calidad. Skunk #1 Automatic comienza a florecer en menos de un mes después de que las plántulas broten del sustrato. Una vez iniciada, la fase de floración es vigorosa y productiva, con una duración de 45 a 55 días, asimismo las plantas menos desarrolladas no revegetarán.</p><p>Responde estupendamente bajo iluminación artificial, en primavera y verano también puede florecer en exterior en muchos lugares por debajo de unos 45 ° N.</p><p>Los cogollos maduros de Skunk #1 Automatic son grandes y compactos, con brillantes glándulas de resina ricas en THC y que están totalmente a la altura de los altos estándares de sus antecesores.</p><p>Su sabor y el efecto deberían resultarles familiar a la mayoría de los amantes del cannabis - un delicioso sabor dulce y picante seguido de ¡una combinación del efecto físico y cerebral tremendamente potente!<p>Características de Skunk #1 Automatic</p> <ul>   <li>Tipo: Autofloreciente feminizada</li>   <li>Genotipo: 35% Índica | 65% Sativa</li>   <li>Cultivo interior y exterior (Templado / Continental)</li>   <li>Periodo de floración: 60-65 días</li>   <li>Producción: media</li>   <li>Altura: compacta</li> </ul>",
