    "Summary": "<p>AutoBlueberry fue creada por diferentes razones, en primer lugar para traer calidad superior al acervo genético de semillas feminizadas automáticas. Blueberry es en sí misma uno de los best-sellers de todos los tiempos, una pasión neerlandesa clásica. Las cualidades especiales de Blueberry son conocidas en todo el mundo.En AutoBlueberry estas cualidades se han incorporado a la forma feminizada y automática.</p>",
    "Description": "<p>Las variedades feminizadas automáticas tienen varias ventajas, por encima de todo que no dependen del ciclo de luz. Las AutoBlueberry estarán listas para la cosecha en aproximadamente diez semanas.</P><P>Las plantas crecerán al aire libre por un breve período, no crecen muy altas y se esconden fácil a los ojos de los visitantes no deseados. Por la misma razón es posible la cosecha al aire libre de dos a tres veces por temporada, dependiendo de la latitud. En latitudes del Norte es una alternativa muy atractiva para un cultivo de verano. En los climas mediterráneo dos o tres cosechas por temporada no son infrecuentes.</p><p>En todos los aspectos AutoBlueberry es una verdadera cosmopolita, En el interior esta variedad es una alternativa increíble para el cultivo de clones.Como genética automática hemos utilizado la Ruderalis canadiense. Retrocruzandola hasta la generación F4 el resultado en AutoBlueberry ha sido convertirse en 100% automática, lo que significa que 25 días después de la germinación de las semillas empiezan a florecer.</p><p>Las plantas todavía llevan la mayor parte de las características del arándano, que es el fenotipo distintivo Blueberry. La mayoría de ellas cogen los famosos tonos azul / violeta coloración, característica de la Blueberry. El olor y el sabor son dulces y afrutados (arándano) y la fuerza y la calidad está por encima de moderado.</p><p>Características de Auto Blueberry</p> <ul>  <li>Tipo: Autofloreciente Feminizada</li>  <li>60% Indica / 20%Sativa / 20% Rudelaris</li>  <li>Cultivo interior y exterior</li>  <li>Floración: 10 semanas</li>  <li>Producción: Media</li>  <li>THC: 7-14%</li> </ul>",
