    "Quantity": 100,
    "Summary": "<p>¿Qué es Light·Mix? Si deseas un mayor control, Light·Mix ofrece la base ideal para promover el crecimiento vigoroso de plantas de semillero, plantas jóvenes y esquejes desde el principio.<p>",
    "Description": "<p>¿Qué es Light·Mix?  Si deseas un mayor control, Light·Mix ofrece la <strong>base ideal para promover el crecimiento vigoroso de plantas de semillero,</strong> plantas jóvenes y esquejes desde el principio. Pone en marcha la microactividad vital, a medida que el agua trabaja con la tierra para producir catalizadores orgánicos que promueven el rápido desarrollo de estructuras radiculares. Light·Mix® es asimismo una mezcla concebida especialmente para asegurar un drenaje óptimo de manera homogénea: algo esencial cuando se utilizan sistemas de riego automático.</p><p>Cómo se utiliza  Este fertilizante se puede aplicar en cantidades más abundantes a cualquier tipo de planta, incluso las más ávidas, sin riesgo de sobrecargar la tierra y provocar una quemadura por nutrientes (algo que se manifiesta en puntas de hojas amarillas, crujientes y quemadas). Con el riego automático es importante que el agua se infiltre adecuadamente en el sustrato, o de lo contrario este se podría humedecer en exceso llegando a formar moho.</p><p>Los valores de pH y EC  Los productos Biobizz® contienen únicamente elementos orgánicos naturales, en lugar de sales minerales como el magnesio o los sulfatos que se pueden encontrar en los fertilizantes sintéticos. Eso confiere a Light·Mix® un valor de conductividad eléctrica (EC) medio. Y aunque es imposible medir sus elementos orgánicos, estos tienen un sistema de autorregulación que ayuda a mantener los valores de pH en el nivel correcto.</p><p>Si deseas mayor control, Light Mix ofrece la base ideal para promover el crecimiento vigoroso de plantas de semillero, plantas jóvenes y esquejes desde el principio. Pone en marcha la micro actividad vital, a medida que el agua trabaja con el sustrato, para producir catalizadores orgánicos que promueven el rápido desarrollo de estructuras radiculares. Light Mix es asimismo una mezcla concebida especialmente para un drenaje óptimo de manera homogénea.<p>",
