    "Description": "<p>Cookies Kush de Barney´s Farm es una variedad de marihuana 100% feminizada <strong>fruto del cruce y selección de una preciosa Girl Scout Cookies y un clon elite OG Kush denominado Feno Rolex</strong> que destaca por su escandalosa producción de resina y el grosor de las flores y en cuya descendencia se continuó trabajando para fijar los rasgos característicos que ahora nos encontramos. El resultado es un híbrido con predominancia índica, un gran trabajo de crianza con el que conseguiremos unas plantas con un vigor, impresionante sabor y una potencia muy elevada.</p> <p>Cookies Kush de Barney´s Farm es una planta de pequeño tamaño, muy compacta y que crece con gran rapidez. En interior es perfecta para cultivar en SOG dada su facilidad en concentrar su producción en la punta apical, aunque con otras técnicas como SCROG o MAIN-LINING obtendrás unos grandísimos resultados igualmente. Tiene un rendimiento alto, con cosechas de hasta 650 gramos por m2 en aproximadamente 50 días desde el cambio de fotoperíodo y donde sus cogollos engordarán día a día cubriéndose de una gruesa capa de resina blanca muy aromática y sugerente. En exterior alcanza un tamaño de 100 a 150 cm, ideal para pequeños balcones o terrazas o jardines de reducidas dimensiones donde pasará desapercibida y que cosecharemos hacia finales de septiembre. Sus sabores son muy complejos y sutiles, a chocolate, menta y galletas recién horneadas. Los efectos potentes y duraderos, ideal para disfrutar después de un duro día de trabajo y desconectar de nuestras preocupaciones.</p> <p>En Konkatienda encontrarás todas las semillas variedades de Barney´s Farm, uno de los más prestigiosos bancos de semillas holandeses. Cookies Kush es una planta de fácil cultivo, resistente y que llenará tu armario, jardín o terraza de unos aromas a galletas de chocolate y menta que estarás deseando que pasen las semanas para poder degustar tan exquisitos cogollos.</p>",
