    "Description": "<p>Amnesia Lemon de Barney´s Farm es una variedad de marihuana feminizada, un <strong>híbrido índico/sativo cruce de los míticas</strong> variedades holandesas como son la Skunk Lemon y la Amnesia Haze. Se trata de una planta muy elegante, con tamaño medio y una gran producción de resinosos cogollos con un increíble sabor a limón y repletos de resina. Ganadora de un Segundo y Primer premio en la Cannabis Cup del 2007, es una planta que todo cultivador debería probar.</p> <p>Amnesia Lemon de Barney´s Farm crece con gran vigor con hojas grandes de un verde intenso, internudos cortos y numerosas ramas laterales que le dan el aspecto de un pequeño abeto. Es una planta de porte medio, aproximadamente 170 cm de altura y tiene un período de floración en exterior que nos permitirá cosechar a finales de octubre. En interior es una planta que se adapta perfectamente a cualquier técnica de cultivo como puede ser SOG gracias a la facilidad de concentrar la producción en las apicales o SCROG o MAIN-LINING. Ya que ramifica con mucha rapidez cuando cuenta con un buen tamaño, cuenta con un tiempo de floración de unas 9-10 semanas, donde sus cogollos se irán cubriendo de una espesa capa de resina con unos aromas sutiles e intensos a limón con trasfondos skunk que inundarán toda nuestra zona de cultivo. Sus efectos son de sativa, muy psicodélicos, cerebrales y eufóricos que dejarán paso a una agradable sensación te tranquilidad, ideales para disfrutar solo o en compañía a cualquier hora del día.</p> <p>En Konkatienda podrás encontrar las mejores variedades de marihuana del mercado de los bancos de semillas más representativos. Barney´s Farm es un banco holandés con una larga trayectoria y numerosos premios recogidos que avalan su gran calidad, como es el caso de Amnesia Lemon, una planta con la que cualquier tipo de cultivador disfrutará tanto con su cultivo como son el increíble sabor y potencia de sus cogollos, muy apropiada incluso para usar como marihuana medicinal para tratar problemas de estrés o agotamiento muscular.</p>",
