    "Description": "<p>Ayahuasca Purple de Barney´s Farm es una variedad de marihuana 100% feminizada fruto del <strong>cruce de una Red River</strong> criada y mantenida en Alaska por un ex marine de los Estados Unidos y una Master Kush cedida por Sensi Seeds para este gran trabajo con el fin de conseguir un híbrido perfecto. El resultado es esta gran cepa con predominancia índica y que recibe su nombre la la Ayahuasca, una bebida que usaban los nativos americanos como medicina y para llegar a conectar con los espíritus. Tiene una gran producción de cogollos que en flora adquieren unos preciosos tonos púrpuras intensos, con gran potencia y un período de floración muy corto, una planta tan completa como hermosa que hará las delicias de cualquier cultivador y causará envidia entre los amigos y conocidos.</p> <p>Ayahuasca Purple de Barney´s Farm es una planta de pequeño tamaño, muy compacta y que crece con gran rapidez. En interior es perfecta para cultivar en SOG dada su facilidad en concentrar su producción en la punta apical. Tiene un rendimiento alto, con cosechas de hasta 650 gramos por m2 en tan sólo 50 días desde el cambio de fotoperíodo. En exterior alcanza un tamaño de 100 a 150 cm, ideal para pequeños balcones o terrazas donde pasará desapercibida y más aún con los tonos morados y púrpuras que nadie relacionada con marihuana y que cosecharemos sobre mediados de septiembre. Sus sabores son muy dulces y afrutados y los efectos potentes y duraderos, con hasta un 21% de THC y 0,9% de CBD, ideal para disfrutar mejor a cualquier hora de la tarde o la noche.</p> <p>En Konkatienda encontrarás todas las semillas variedades de Barney´s Farm, uno de los más prestigiosos bancos de semillas holandeses. Ayahuasca Purple es una planta de fácil cultivo, resistente y que llenará tu armario, jardín o terraza de unos aromas y unos colores exóticos, lo que hará que sin duda sea una de las reinas de tu cultivo y una de tus preferidas a la hora de decidir qué fumar.</p>",
