    "Description": "<p><strong>Laughing Buddha</strong> de Barney´s Farm es una variedad de marihuana con predominancia sativa, cruce de dos de genéticas poderosas como son Thai y Jamaican y que destacan por sus efectos potentes de sativa, muy elevados. Ganadora de un prestigioso Tercer Premio en la Cannabis Cup de 2003, es una planta con un crecimiento elegante y vigoroso, con una floración muy rápida para la enorme carga de sativa que contiene y que junto a su potencia, producción y sabor, hará que sea una de las estrellas del cultivo sin lugar a dudas.</p> <p>Laughing Buddha de <strong>Barney´s Farm</strong> crece rápido y con un gran vigor tanto en interior como en exterior, adaptándose muy bien a cualquier técnica de cultivo y siendo muy apropiada para cultivos en  SOG ,  MAIN-LINING .o  SCROG . Generalmente su estatura es media-alta, de internudos medios y gruesas ramas que se llenarán en floración de una gran cantidad de grandes cogollos muy resinosos y con un aroma muy frutal y penetrante. Tiene un tiempo de floración de aproximadamente 10 semanas en interior y estará lista para su cosecha entre mediados y finales de octubre en exterior con enormes producciones de cogollos con una gran producción de flores muy densas y compactas. Sus sabores son frescos y dulces, a frutas maduras con una potencia alta y unos efectos muy energéticos y cerebrales con la que disfrutarás riendo con los amigos o realizando cualquier tarea creativa dejando volar la imaginación.</p> <p>En <strong>Konkatienda</strong> contamos con las mejores variedades de los mejores bancos de semillas del mercado, como es el caso de Barney´s Farm, uno de los más representativos y con más tradición de Holanda y que destaca por sus variedades medicinales y sus poderosos híbridos como Laughing Buddha, una planta muy apropiada para climas templados o cálidos, de muy fácil cultivo y que gustará tanto a cultivadores principiantes como al más veterano y sibarita.</p>",
