    "Description": "<p><strong>G13 Haze</strong> de Barney´s Farm es una variedad de marihuana disponible en versión feminizada o regular, un gran híbrido resultado del cruce de una planta con genética G13, mítica y enigmática cepa creada en Estados Unidos, y una Hawaiian Sativa. La combinación nos ofrece unos ejemplares con un porcentaje de sativa del 80% y una potencia muy elevada, nada recomendable para fumadores principiantes. Ha sido ganadora de un Primer y Segundo premio en la Cannabis Cup, lo que nos hace imaginarnos con qué clase de planta vamos a tratar.</p> <p>G13 Haze de <strong>Barney´s Farm</strong> crece compacta y con fuerza, con internudos medio-largos y largas ramas laterales que ayudarán a soportar el peso de las densas flores. Es una planta de porte medio-alto, con un período de floración en exterior que nos permitirá cosechar a mediados de octubre una gran cantidad de cogollos muy compactos y resinosos. En interior se adapta perfectamente a cualquier técnica de cultivo, tanto  SOG .donde partiendo de pequeños esquejes conseguiremos largas y gordas colas de flores, o  SCROG .o  MAIN-LINING .por su gran facilidad para ramificar. Tiene un período de floración de unos 70-80 días con producciones cercanas a los 550 gramos por m2. Los sabores y aromas son complejos, a menta, frutas y especias, con una potencia muy elevada y de efectos triposos, no apta para todos los fumadores que no suelen ser capaces de dar más de 3 o 4 caladas seguidas. En ocasiones los cogollos llegan a un 22% de THC y 1,2% de CBD, ideales para pasar inolvidables momentos con los amigos, reír o realizar cualquier tipo de tarea creativa.</p> <p>En <strong>Konkatienda</strong> contamos con las mejores variedades de los mejores bancos de semillas del mercado, como es el caso de G13 Haze de Barney´s Farm, una variedad de muy fácil cultivo, muy apropiada para climas cálidos y templados, ideal para aquellos cultivadores que busquen una planta muy potente con la que volar a un mundo nuevo de sensaciones.</p>",
