    "Description": "<p><strong>Triple Cheese</strong> de Barney´s Farm es una variedad de marihuana 100% feminizada <strong>fruto de la combinación de una selección de Cheese con un clon elite de Blue Cheese</strong>. El resultado es que cabe esperar con el nombre de los padres, obteniendo unas plantas con un increíble sabor a queso curado, Skunk y ligeros trasfondos a frutas del bosque de su herencia Blueberry, con una potencia muy elevada y gran producción de compactos y resinosos cogollos repletos de exquisitas fragancias.</p> <p>Triple Kush de Barney´s Farm es una planta de pequeño tamaño, muy compacta y que crece con gran vigorosidad. En interior es perfecta para cultivar en  SOG .dada su facilidad en concentrar su producción en la punta apical como toda buena genética Skunk, aunque con otras técnicas como  SCROG .o  MAIN-LINING .obtendrás unos grandísimos resultados igualmente, optimizando al máximo la producción. Tiene un rendimiento alto, con cosechas de hasta 600 gramos por m2 en aproximadamente 8 semanas desde el cambio de fotoperíodo y donde sus cogollos engordarán día a día cubriéndose de una gruesa capa de resina blanca muy aromática y sugerente que en ocasiones puede adquirir unos tonos lavanda espectaculares. En exterior alcanza un tamaño algo superior al metro, ideal para pequeños balcones o terrazas o jardines de reducidas dimensiones donde pasará desapercibida y que cosecharemos hacia finales de septiembre. Sus sabores son muy complejos y sutiles, a chocolate, menta y galletas recién horneadas. Los efectos potentes y duraderos, con hasta un 20% de THC y un 0,8% de CBD, ideal para disfrutar después de un duro día de trabajo o pasar buenos momentos de relax con nuestros mejores amigos.</p> <p>En Konkatienda encontrarás todas las semillas variedades de <strong>Barney´s Farm</strong>, uno de los más prestigiosos bancos de semillas holandeses. Triple Cheese es una planta de fácil cultivo, muy resistente a humedades y que llenará tu armario, jardín o terraza de unos aromas a queso espectaculares y con los que cualquier cultivador por muy principiante o veterano que sea disfrutará, os lo garantizamos.</p>",
