    "Description": "<p><strong>Peppermint Kush</strong> de Barney´s Farm es una variedad de marihuana 100% feminizada y uno de los últimos trabajos de este prestigioso banco de semillas holandés. Se trata de una <strong>gran combinación entre un clon elite de Stella Blue y una selección de los mejores ejemplares de Nepal Kush</strong>, resultando una hermosa planta que destaca por su elegante crecimiento, la producción de pesados y densos cogollos con unos aromas muy dulces y frescos con toques picantes, clara herencia de sus dos ancestros.</p> <p>Peppermint Kush de Barney´s Farm crece compacta y con fuerza, con internudos cortos y fuertes ramas laterales. Es una planta de porte bajo, ideal para cultivar en pequeñas terrazas, balcones o jardines, ya que será muy sencilla de disimular o esconder de miradas indiscretas. Tiene un período de floración muy rápido que nos permitirá cosechas a mediados de septiembre una gran producción de cogollos, muy compactos y resinosos. En interior es una variedad que se adapta muy bien a cualquier técnica de cultivo como  SOG ,  SCROG .o  MAIN-LINING .y que cosecharemos en unos 55 días tras el cambio del fotoperíodo con unos increíbles rendimientos de hasta 600 gramos por m2. Sus sabores y aromas son embriagadores y sutiles, terrosos, picantes y mentolados, una delicia hasta para el paladar más sibarita. Su potencia es muy elevada, con un 18% de THC y 1,1% de CBD, ideal para usar como marihuana medicinal y tratar trastornos del sueño, estrés, cansancio...</p> <p>En Konkatienda contamos con las mejores variedades de los mejores bancos de semillas del mercado, como es el caso de Peppermint Kush de <strong>Barney´s Farm</strong>, una variedad 100% índica y medicinal, de muy fácil cultivo, muy apropiada para climas húmedos y templados y que en un período de floración muy corto nos proporcionará unas grandes cosechas de exquisitos cogollos y con la que disfrutará tanto el cultivador que amante de las índicas como el que busque una buena variedad de marihuana medicinal.</p>",
